-- precomputation ~0.14s
main = do
  [k,n] <- fmap (fst . fromJust . B.readInt) . B.words <$> B.getLine :: IO [Int]
  B.putStr $ if k `elem` zeroes
             then "0"
             else B.pack . show $ if n >= 10000
                                  then (tb !! fromJust (elemIndex k nonzeroes)) !! ((n `div` 10000) - 1)
                                       + solve (10000 * (n `div` 10000)) k n
                                  else solve 0 k n

-- precompute table ~35s
main' = do
  print $ sum . fmap last $ mkTb

-- no precomputation ~6s
main'' = do
  [k,n] <- fmap (fst . fromJust . B.readInt) . B.words <$> B.getLine :: IO [Int]
  B.putStr . B.pack . show $ solve 0 k n

-- solve partial problem
solve d k n = length . filter id . fmap isSemiprime . take (n-d) . drop d $ f (word k)

f k = let fk = (42 : 11*k+77 : zipWith (((+ (10*k)) .) . (-) . (*2)) (tail fk) fk) in headStrict fk

headStrict [] = []
headStrict (x:xs) = x `seq` (x : headStrict xs)
{-# INLINE headStrict #-}

word :: Int -> Word64
word = fromIntegral

-- note that: 79371 = ceiling . (**(1/3)) . fromIntegral $ f 100 !! 1000000
-- only need primes <= 79371
isSemiprime n = let smallDivisors = findDivisors n primes
                in case length smallDivisors of
                     0 -> not (isMillerRabinPrime n) -- no divisors < cube root, so either two divisors or prime
                     1 -> isMillerRabinPrime (n `div` head smallDivisors) -- one small divisor, if quotient is prime then two divisors total
--                   2 -> n == product smallds -- two divisors both < cube root, so there must be a third divisor, so fall through
                     _ -> False -- three or more divisors

-- find (at most three) divisors of n, less than cube root of n, short circuiting where possible
findDivisors n = go [] n
  where
    rootn = ceiling . (**(1/3)) . fromIntegral $ n
    go !acc !n [] = acc
    go !acc !n (c:cs) = if n < c || rootn < c || length acc >= 3
                        then acc
                        else if c `divides` n
                             then go (c:acc) (n `div` c) (c:cs)
                             else go acc n cs
    {-# INLINE go #-}
{-# INLINE findDivisors #-}

divides k n = n `rem` k == 0
{-# INLINE divides #-}

-- Primes utils adapted from elsewhere
isMillerRabinPrime :: Word64 -> Bool
isMillerRabinPrime n
   | even n    = (n==2)
   | n < 100   = (n `elem` takeWhile (< 100) primes)
   | otherwise = let ws = witnesses n
                 in and [test n (pred n) evens (head odds) a | a <- ws]
  where
    (evens,odds) = span even (iterate (`div` 2) (pred n))

test n n_1 evens d a = x `elem` [1,n_1] || n_1 `elem` powers
  where
    x = powerMod n a d
    powers = map (powerMod n a) evens

witnesses n
  | n < 9080191         = [31,73]
  | n < 4759123141      = [2,7,61]
  | n < 3474749660383   = [2,3,5,7,11,13]
  | n < 341550071728321 = [2,3,5,7,11,13,17]
  | otherwise           = [2,3,5,7,11,13,17,19,23] -- sufficient for deterministic Miller-Rabin here (<= 500000635000042)

-- powerMod m x n = x^n `mod` m
powerMod m x n  = f (n - 1) x x `rem` m
  where
  f d a y = if d==0 then y else g d a y
  g i b y | even i    = g (i `quot` 2) (b*b `rem` m) y
          | otherwise = f (i-1) b (b*y `rem` m)

-- adapted from The Genuine Sieve of Eratosthenes by Melissa E. O'Neill
-- list version due to John Hughes
primes = 2:([3..] `minus` composites)
  where
    composites = union [multiples p | p <- primes]
multiples n = map (n*) [n..]
(x:xs) `minus` (y:ys)  = case x `compare` y of
                           LT -> x:(xs `minus` (y:ys))
                           EQ -> xs `minus` ys
                           GT -> (x:xs) `minus` ys
union = foldr merge []
  where
    merge (x:xs) ys = x:merge' xs ys
    merge' (x:xs) (y:ys) = case x `compare` y of
                             LT -> x:merge' xs (y:ys)
                             EQ -> x:merge' xs ys
                             GT -> y:merge' (x:xs) ys

